import React from 'react'
import {useDispatch} from 'react-redux';
import {push} from 'connected-react-router';

function Home() {
  const dispatch = useDispatch()

  return (
    <div>
      <h2>ホーム</h2>
      <button onClick={() => dispatch(push('/login'))}>
        ログイン画面へ
      </button>
    </div>
  )
}

export default Home
